import React, { useState } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import {
  FaHome,
  FaRoute,
  FaBus,
  FaCalendarAlt,
  FaChartBar,
  FaUsers,
  FaUserShield,
  FaHeadset,
  FaBars,
  FaSignOutAlt,
  FaUserCircle,
  FaBell
} from 'react-icons/fa';

const AdminLayout = ({ children }) => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();
  const { user, logout } = useAuth();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const menuItems = [
    { path: '/admin/dashboard', name: 'Dashboard', icon: <FaHome className="mr-3" /> },
    { path: '/admin/routes', name: 'Routes & Locations', icon: <FaRoute className="mr-3" /> },
    { path: '/admin/vehicles', name: 'Vehicles', icon: <FaBus className="mr-3" /> },
    { path: '/admin/schedules', name: 'Schedules', icon: <FaCalendarAlt className="mr-3" /> },
    { path: '/admin/analytics', name: 'Analytics', icon: <FaChartBar className="mr-3" /> },
    { path: '/admin/customers', name: 'Customers', icon: <FaUsers className="mr-3" /> },
    { path: '/admin/staff', name: 'Staff Management', icon: <FaUserShield className="mr-3" /> },
    { path: '/admin/customer-service', name: 'Customer Service', icon: <FaHeadset className="mr-3" /> },
  ];

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div 
        className={`bg-gray-800 text-white w-64 space-y-6 py-7 px-2 absolute inset-y-0 left-0 transform ${
          sidebarOpen ? 'translate-x-0' : '-translate-x-full'
        } md:relative md:translate-x-0 transition duration-200 ease-in-out z-10`}
      >
        <div className="flex items-center justify-between px-4">
          <div className="flex items-center space-x-2">
            <span className="text-2xl font-extrabold">TransportBook</span>
          </div>
          <button onClick={toggleSidebar} className="md:hidden">
            <FaBars />
          </button>
        </div>

        <nav className="mt-10">
          {menuItems.map((item) => (
            <Link
              key={item.path}
              to={item.path}
              className={`flex items-center py-2 px-4 rounded transition duration-200 ${
                location.pathname === item.path
                  ? 'bg-blue-600 text-white'
                  : 'text-gray-300 hover:bg-gray-700'
              }`}
            >
              {item.icon}
              {item.name}
            </Link>
          ))}
        </nav>

        <div className="px-4 mt-auto">
          <div className="pt-6 border-t border-gray-700">
            <button
              onClick={handleLogout}
              className="flex items-center py-2 px-4 rounded text-gray-300 hover:bg-gray-700 w-full"
            >
              <FaSignOutAlt className="mr-3" />
              Logout
            </button>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="flex-1 flex flex-col overflow-hidden">
        {/* Top Navigation */}
        <header className="bg-white shadow-sm">
          <div className="flex items-center justify-between p-4">
            <button onClick={toggleSidebar} className="md:hidden">
              <FaBars className="text-gray-600" />
            </button>

            <div className="flex items-center space-x-4">
              <div className="relative">
                <FaBell className="text-gray-600 text-xl" />
                <span className="absolute -top-1 -right-1 bg-red-500 text-white rounded-full w-4 h-4 flex items-center justify-center text-xs">
                  3
                </span>
              </div>
              <div className="flex items-center space-x-2">
                <FaUserCircle className="text-gray-600 text-2xl" />
                <span className="text-gray-700 font-medium">{user?.name || 'Admin User'}</span>
              </div>
            </div>
          </div>
        </header>

        {/* Content */}
        <main className="flex-1 overflow-y-auto bg-gray-100 p-4">
          {children}
        </main>
      </div>
    </div>
  );
};

export default AdminLayout;
